import React,{Component} from 'react';
import './index.scss';
class registered extends Component{
    render(){
        return(
            <div className='registered'>
                <div className='layout-container'>
                    <div className='lark-form'>
                        <div className='lark-form-main'>
                            <div className='lark-form-logo'>
                            <a href="/"><img src="https://gw.alipayobjects.com/zos/rmsportal/kyjrtmqaKAvzJAaoZfFp.svg" alt="语雀" /></a>
                            </div>
                            <div className='lark-form-content form-pro'>
                            <div className='account-slogon'>
                            <h2 class="account-slogon-main">欢迎加入语雀</h2>
                            <p class="account-slogon-subhead"><span>写文档，就用语雀</span></p>

                            </div>
                            <div className='account-register'>
                            <Form onSubmit={this.handleSubmit} className="login-form">
                            <FormItem>
                              {getFieldDecorator('userName', {
                                rules: [{ required: true, message: 'Please input your username!' }],
                              })(
                                <Input prefix={<Icon type="user" style={{ color: 'rgba(0,0,0,.25)' }} />} placeholder="Username" />
                              )}
                            </FormItem>
                            <FormItem>
                              {getFieldDecorator('password', {
                                rules: [{ required: true, message: 'Please input your Password!' }],
                              })(
                                <Input prefix={<Icon type="lock" style={{ color: 'rgba(0,0,0,.25)' }} />} type="password" placeholder="Password" />
                              )}
                            </FormItem>
                            <FormItem>
                              {getFieldDecorator('remember', {
                                valuePropName: 'checked',
                                initialValue: true,
                              })(
                                <Checkbox>Remember me</Checkbox>
                              )}
                              <a className="login-form-forgot" href="">Forgot password</a>
                              <Button type="primary" htmlType="submit" className="login-form-button">
                                Log in
                              </Button>
                              Or <a href="">register now!</a>
                            </FormItem>
                          </Form>
                            </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default registered;
